import React from 'react';

const calculatorSummary = (props) => {
    return (
        <div>
            <center><h1>Summary for the month {props.workedMonthName}</h1>
                <br></br>
                Time dimension on this date: {props.workedHoursInMonth}h, working hours: {props.workedHours}h<br></br>
                Hourly rate (gross): {props.hourlyFee}zł<br></br>
                Number of overtime hours: {props.overHoursAmount}, gross salary: {props.overHoursGrossIncome}zł<br></br>
                Number of overtime hours: {props.overHoursAmount}, net salary: {props.overHoursNetIncome}zł<br></br>
                Total gross salary (base + overhours): {props.totalGrossIncome}zł<br></br>
                Total net salary (base + overhours): {props.totalNetIncome}zł<br></br><br></br>
                <button onClick={props.handleCloseSummary(closeSummary)}>Ok</button>
            </center>
        </div>
    );
}

export default calculatorSummary;
